// src/components/CloudEdgeLogo.jsx
import React from 'react';

const CloudEdgeLogo = ({ className }) => (
  <svg className={className} viewBox="0 0 40 40" fill="none" xmlns="http://www.w3.org/2000/svg">
    <defs>
      <linearGradient id="logoGradient" x1="0%" y1="0%" x2="100%" y2="100%">
        <stop offset="0%" stopColor="#6366F1" />
        <stop offset="100%" stopColor="#4F46E5" />
      </linearGradient>
    </defs>
    {/* Main Circle */}
    <circle cx="20" cy="20" r="18" fill="url(#logoGradient)" fillOpacity="0.1" stroke="url(#logoGradient)" strokeWidth="2" />
    
    {/* Connected Nodes */}
    <path 
      d="M14 20H26M20 14V26M14 14L26 26M26 14L14 26" 
      stroke="url(#logoGradient)" 
      strokeWidth="2" 
      strokeLinecap="round" 
    />
    
    {/* Center Point */}
    <circle cx="20" cy="20" r="2" fill="url(#logoGradient)" />
    
    {/* Edge Points */}
    <circle cx="14" cy="14" r="1.5" fill="url(#logoGradient)" />
    <circle cx="26" cy="14" r="1.5" fill="url(#logoGradient)" />
    <circle cx="14" cy="26" r="1.5" fill="url(#logoGradient)" />
    <circle cx="26" cy="26" r="1.5" fill="url(#logoGradient)" />
  </svg>
);

export default CloudEdgeLogo;
